import React from "react";
import Table from "./Table";
import SearchBar from "./SearchBar"

const styles = {
  navbar: {
    height: "120px"
  },
  nameFont: {
    fontSize: "34px",
    fontWeight: "bold"
  },
  h1: {
    textAligned: "center"
  }
};


function EmployeeTable() {
  return (
    <div>
      <section className="hero is-light">
        <SearchBar />
      </section>
      <div>
        <Table />
      </div>
    </div>
  )
}
export default EmployeeTable;
